import React from "react"
import { PortfolioCardContainer,PortfolioCardLayout } from "./PortfolioCard.style"
import GradientBackground from "../GradientBackground/GradientBackground"
import portfoliocardDP from "/portfoliocardDP.png"
export default function PortfolioCard(){
    return(
        <PortfolioCardContainer>
            <PortfolioCardLayout>
            <img src={portfoliocardDP}  alt="temporary dp photo" style={{ borderRadius:'10px',width: '250px',marginTop:'2rem', marginBottom:'1rem'}} />

            </PortfolioCardLayout>
        </PortfolioCardContainer>
    )
}
